import React, { useState } from 'react'
import { Form } from 'react-router-dom'
import { AiOutlineEyeInvisible, AiOutlineEye } from "react-icons/ai";
import { toast } from 'react-hot-toast';

const SignupForm = ({setIsLoggedIn}) => {
    const[showPassword,setShowPassword]=useState(false);
    const[confirmPassword,setConfirmPassword]=useState(false);
    const[FormData,setFormData]=useState({firstName:"",lastName:"", email:"" ,password:"",confirmPassword:""})
    function changeHandler(e){
        setFormData((prevData)=>{
            return  {...prevData,[e.target.name]:e.target.value} 
        })
    }
    function submithandler(e){
        e.preventDefault();
        if(FormData.password!=FormData.confirmPassword){
            toast.error("Password do not match");
        }
        else{
            setIsLoggedIn(t)
        }
    }
  return (
    <div>
            <div>
                <button>Student</button>
                <button>Instructor</button>
            </div>
        <form onSubmit={submithandler} action="">
            <div>

            <label>
                <p>First Name<sup>*</sup></p>
                <input required type="text" name='firstName' value={FormData.firstName} onChange={changeHandler} placeholder='enter first name'  />
            </label>
            <label>
                <p>Last Name<sup>*</sup></p>
                <input required type="text" name='lastName' value={FormData.lastName} onChange={changeHandler} placeholder='enter last name'  />
            </label>
            </div>
            
                <label >
                    <p>Email Address <sup>*</sup></p>
                <input required type="email" name="email" id="" value={FormData.email} placeholder='enter email address' onChange={changeHandler} />
                </label>
          
            <div>
            <label >
                    <p>Password <sup>*</sup></p>
                <input required type={showPassword?('text'):('password')} name="password" id="" value={FormData.password} placeholder='enter password' onChange={changeHandler}/>  
                <span onClick={() => setShowPassword(!showPassword)}>
                    {showPassword ? <AiOutlineEyeInvisible  /> : <AiOutlineEye fontSize={24}  />}
                </span>
                </label>
                <label >
                    <p>Confirm Password <sup>*</sup></p>
                <input required type={confirmPassword?('text'):('password')} name="confirmPassword" id="" value={FormData.confirmPassword} placeholder='confirm password'onChange={changeHandler} />
                <span onClick={() => setConfirmPassword(!confirmPassword)}>
                    {confirmPassword ? <AiOutlineEyeInvisible  /> : <AiOutlineEye fontSize={24}  />}
                </span>
                </label>
            </div>
            <button>Create Account</button>
        </form>
    </div>
  )
}

export default SignupForm
